%[text] # 创建一个金刚石TB模型并拟合参数
%[text] 
%[text] ## 创建模型
%[text] - 声明一个空的模型；初始化其轨道数 \
%addpath('..');
Diamond = HR(8) %[output:376449c8]
%%
%[text] - 修改POSCAR\_Diamond格式 \
%[text] generated by phonopy
%[text]    1\.0
%[text]      0\.0000000000000000    1.7868549235128819    1.7868549235128819
%[text]      1\.7868549235128819    0.0000000000000000    1.7868549235128819
%[text]      1\.7868549235128819    1.7868549235128819    0.0000000000000000
%[text] C
%[text]    2
%[text] Direct
%[text]   0\.2500000000000000  0.2500000000000000  0.2500000000000000 C sp
%[text]   0\.0000000000000000  0.0000000000000000  0.0000000000000000 C sp

%[text] - 导入POSCAR \
Diamond = Diamond <'POSCAR_Diamond' %[output:218c1933] %[output:8691664b] %[output:8a477386]
%%
%[text] - 进行 nn\_sk 搜索
%[text] - 这里 search\_range 取 【2 2 2】因为是小开角元胞
%[text] - Accuracy 取小数点3位，maxR值取 2.8 埃 \
search_range = [2 2 2];
Accuracy = 1e-3;
r_max_search = 2.8;
Diamond = Diamond.nn(search_range,Accuracy ,r_max_search); %[output:02933c8f]
%%
%[text] - 可以简要获取一下这一步的信息，看下Rnn排名 \
[Rnn,~,~,~] = Diamond.nn_information();
%%
%[text] - 这里我们取最近邻hopping
%[text] - 我们关心 s轨道与p轨道的劈裂 \
Diamond = Diamond.H_TBSK_gen('level_cut',1,'per_dir',[1 1 1],'onsite',true);  %[output:57efde79]
Diamond.autohermi %[output:273a2832] %[output:176f837d]
%%
%[text] - 查看一下体系的未知量（symbolic） \
Diamond.symvar_list %[output:73b15141]
%%
%[text] - 导入 KPOINTS信息 高对称点 高对称路径
%[text] - 这里额外配置高对称点 \
Diamond = Diamond<'KPOINTS_Diamond';
[klist_l,kpoints_l,kpoints_name] = Diamond.kpath_information();
%%
%[text] ## 利用MATLAB(2020)控件调整参数 - DFT
%[text] - 导入DFT数据 \
Efermi =  9.85855597;
EIGENCAR_DFT = EIGENVAL_read('vasp','EIGENVAL_Diamond',Efermi); 
%%
%[text] - 创建滑块 \
E__6_0 = 0; %[control:slider:1185]{"position":[10,11]}
E__6_1 = 1;
VppP_1 = 1;
VppS_1 = -2;
VspS_1 = -2;
VssS_1 = 2;
Fermi  = 0;
%%
%[text] - 给TB中的符号化变量赋值 \
Diamond_n = Diamond.Subsall();
%%
%[text] - 生成能带 \
EIGENCAR = Diamond_n.EIGENCAR_gen()-Fermi; %[output:8e00fef6]
%%
%[text] - 画出能带 \
[fig,ax]= bandplot(EIGENCAR_DFT,[-30,30],'title',"Diamond-TB-VppP_1="+string(VppP_1),'Color','b','POSCAR','POSCAR_Diamond','KPOINTS','KPOINTS_Diamond'); %[output:6629296f]
[fig,ax]= bandplot(EIGENCAR ,[-30,30],'title',"Diamond-TB-VppP_1="+string(VppP_1),'ax',ax,... %[output:group:0e77dc05] %[output:6629296f]
    'POSCAR','POSCAR_Diamond','Color','r','KPOINTS','KPOINTS_Diamond'); %[output:group:0e77dc05] %[output:6629296f]
%%
%[text] ## 利用NM办法多参数拟合DFT (初值依赖)
%[text] NM
Efermi =  9.85855597;
EIGENCAR_DFT = EIGENVAL_read('vasp','EIGENVAL_Diamond',Efermi);
Diamond = Diamond.subs(sym('E__6_0'),0);
% 拟合参数设置
% 设定拟合范围：

options_extra.NBAND_range_DFT = [1:5];
options_extra.NBAND_range = [1:5];
options_extra.klist_range = ':';
options_extra.E_range = [];
%%
%[text] 默认大小和斜率等权
options_extra.weight_list = [1,1];
%%
%[text] 键值对：
%[text] - ‘EIGENCAR\_DFT’ 为你的DFT 能带变量名
%[text] - FITobj 为你的拟合对象变量名
%[text] - ‘extra’ 为你的设定的能量范围
%[text] - 'algorithm' 为你选择的比较方法 默认为同时比较大小和斜率 \
%SKTB_single = subs(SKTB);
Loss_func_TB = @(para) TBkit.loss_func(para, ... %[output:group:910fd0dc] %[output:9fae3d2a]
    'FITobj','Diamond',... %[output:9fae3d2a]
    'DFTBAND','EIGENCAR_DFT',... %[output:9fae3d2a]
    'extra','options_extra',... %[output:9fae3d2a]
    'algorithm','pure_comparison' ... %[output:9fae3d2a]
)      %[output:group:910fd0dc] %[output:9fae3d2a]
% 初值给定

%SKTB = SKTB.subs([sym('E__6_1') sym('VppP_1')],[0,2.71353]);
% SKTB.symvar_list
x0 = [ E__6_1, VppP_1, VppS_1, VspS_1, VssS_1];
% 进行拟合

options = optimset('PlotFcns',@optimplotfval,'Display','iter');
x = fminsearch(Loss_func_TB,x0,options);result = mat2cell(x,1,ones(1,length(x))); %[output:158104bb] %[output:24abab34]
E__6_1 = x(1) %[output:043a117e]
VppP_1 = x(2) %[output:230c668d]
VppS_1 = x(3) %[output:72205201]
VspS_1 = x(4) %[output:73fda7fb]
VssS_1 = x(5) %[output:43d63d9e]
%%
%[text] - 给TB中的符号化变量赋值 \
Diamond_n = Diamond.Subsall();
%%
%[text] - 生成能带 \
EIGENCAR = Diamond_n.EIGENCAR_gen()-Fermi; %[output:45055dd4]
%%
%[text] - 画出能带 \
fontname = "Helvetica";
ax =  bandplot(EIGENCAR_DFT,[-30,30],'title',"Diamond-TB-VppP_1="+string(VppP_1),'Color','b','POSCAR','POSCAR_Diamond','KPOINTS','KPOINTS_Diamond'); %[output:172c21c1]
bandplot(EIGENCAR ,[-30,30],'title',"Diamond-TB-VppP_1="+string(VppP_1),'ax',ax,... %[output:group:1bb4eb13] %[output:172c21c1]
    'POSCAR','POSCAR_Diamond','Color','r','KPOINTS','KPOINTS_Diamond'); %[output:group:1bb4eb13] %[output:172c21c1]
%%
